import React, { Fragment } from 'react';
import RootApp from './_app';

const Index = () => {
  console.log('index');
  return (
    <Fragment>
      <div className="container">
        <div className="header_logo">
          <Link href="/">
            <a>
              <img src="../../static/img/logo.png" alt="logo 이미지" />
            </a>
          </Link>
        </div>
        <div className="header_menu">
          <HeaderMenu />
        </div>
      </div>
    </Fragment>
  );
};

export default Index;
